def lru_memoize(maxsize: int = 128):
    """Memoization decorator with LRU eviction."""
    cache = LRUCache(maxsize)

    def decorator(func):
        @functools.wraps(func)
        def wrapper(*args, **kwargs):
            # cachetools.cached works with a key function; the default
            # key uses the function arguments (args, frozenset(kwargs.items())).
            return cached(cache)(func)(*args, **kwargs)
        return wrapper
    return decorator


